=\"https:\/\/ru.wikipedia.org\/wiki\/1833_%D0%B3%D0%BE%D0%B4\" title=\"1833 \u0433\u043e\u0434\">1833<\/a>&#160;\u2014 \u0412 \u0420\u043e\u0441\u0441\u0438\u0438 \u0438\u0437\u0434\u0430\u043d \u0443\u043a\u0430\u0437, \u0432\u043e\u0441\u043f\u0440\u0435\u0449\u0430\u0432\u0448\u0438\u0439 \u043f\u0440\u043e\u0434\u0430\u0436\u0443 \u043a\u0440\u0435\u043f\u043e\u0441\u0442\u043d\u044b\u0445 \u0441 \u043f\u0443\u0431\u043b\u0438\u0447\u043d\u043e\u0433\u043e \u0442\u043e\u0440\u0433\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1835_%D0%B3%D0%BE%D0%B4\" title=\"1835 \u0433\u043e\u0434\">1835<\/a>&#160;\u2014 \u0412\u044b\u0448\u043b\u0430 \u0432 \u0441\u0432\u0435\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BA%D0%B0%D0%B7%D0%BA%D0%B0_%D0%BE_%D1%80%D1%8B%D0%B1%D0%B0%D0%BA%D0%B5_%D0%B8_%D1%80%D1%8B%D0%B1%D0%BA%D0%B5\" title=\"\u0421\u043a\u0430\u0437\u043a\u0430 \u043e \u0440\u044b\u0431\u0430\u043a\u0435 \u0438 \u0440\u044b\u0431\u043a\u0435\">\u0421\u043a\u0430\u0437\u043a\u0430 \u043e \u0440\u044b\u0431\u0430\u043a\u0435 \u0438 \u0440\u044b\u0431\u043a\u0435<\/a>, \u043d\u0430\u043f\u0438\u0441\u0430\u043d\u043d\u0430\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%83%D1%88%D0%BA%D0%B8%D0%BD,_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_%D0%A1%D0%B5%D1%80%D0%B3%D0%B5%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u041f\u0443\u0448\u043a\u0438\u043d, \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u0421\u0435\u0440\u0433\u0435\u0435\u0432\u0438\u0447\">\u0410.C. \u041f\u0443\u0448\u043a\u0438\u043d\u044b\u043c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1869_%D0%B3%D0%BE%D0%B4\" title=\"1869 \u0433\u043e\u0434\">1869<\/a>&#160;\u2014 \u041e\u0441\u043d\u043e\u0432\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D1%80%D0%BE%D0%B4\" title=\"\u0413\u043e\u0440\u043e\u0434\">\u0433\u043e\u0440\u043e\u0434<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BA%D1%82%D1%8E%D0%B1%D