"1878 \u0433\u043e\u0434\">1878<\/a>&#160;\u2014 \u041d\u0430\u0437\u0432\u0430\u043d\u0438\u0435 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D0%B7%D0%B5%D0%BB%D0%B8%D0%BD\" title=\"\u0412\u0430\u0437\u0435\u043b\u0438\u043d\">\u0432\u0430\u0437\u0435\u043b\u0438\u043d<\/a>\u00bb \u0437\u0430\u043f\u0430\u0442\u0435\u043d\u0442\u043e\u0432\u0430\u043d\u043e \u043a\u0430\u043a \u0442\u043e\u0440\u0433\u043e\u0432\u0430\u044f \u043c\u0430\u0440\u043a\u0430. \u042d\u0442\u043e \u0441\u0440\u0435\u0434\u0441\u0442\u0432\u043e \u0438\u0437\u043e\u0431\u0440\u0451\u043b \u044d\u043c\u0438\u0433\u0440\u0438\u0440\u043e\u0432\u0430\u0432\u0448\u0438\u0439 \u0432 \u0410\u043c\u0435\u0440\u0438\u043a\u0443 \u0430\u043d\u0433\u043b\u0438\u0447\u0430\u043d\u0438\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B5%D0%B7%D0%B1%D1%80%D0%BE,_%D0%A0%D0%BE%D0%B1%D0%B5%D1%80%D1%82\" title=\"\u0427\u0435\u0437\u0431\u0440\u043e, \u0420\u043e\u0431\u0435\u0440\u0442\">\u0420\u043e\u0431\u0435\u0440\u0442 \u0427\u0435\u0437\u0431\u0440\u043e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1891_%D0%B3%D0%BE%D0%B4\" title=\"1891 \u0433\u043e\u0434\">1891<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0435<\/a> \u043f\u0440\u043e\u0448\u043b\u043e \u043f\u0435\u0440\u0432\u043e\u0435 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u043e\u0432\u0430\u043d\u043d\u043e\u0435 \u043f\u0440\u0430\u0437\u0434\u043d\u043e\u0432\u0430\u043d\u0438\u0435 \u0440\u0443\u0441\u0441\u043a\u0438\u043c\u0438 \u0440\u0430\u0431\u043e\u0447\u0438\u043c\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%80%D0%B2%D0%BE%D0%B5_%D0%BC%D0%B0%D1%8F_(%D0%BF%D1%80%D0%B0%D0%B7%D0%B4