0%B8%D1%81\" title=\"\u0421\u0435\u043d\u0442-\u041b\u0443\u0438\u0441\">\u0421\u0435\u043d\u0442-\u041b\u0443\u0438\u0441\u0435<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a>) \u043e\u0442\u043a\u0440\u044b\u0432\u0430\u044e\u0442\u0441\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B5%D1%82%D0%BD%D0%B8%D0%B5_%D0%9E%D0%BB%D0%B8%D0%BC%D0%BF%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B5_%D0%B8%D0%B3%D1%80%D1%8B_1904\" title=\"\u041b\u0435\u0442\u043d\u0438\u0435 \u041e\u043b\u0438\u043c\u043f\u0438\u0439\u0441\u043a\u0438\u0435 \u0438\u0433\u0440\u044b 1904\">III \u041b\u0435\u0442\u043d\u0438\u0435 \u041e\u043b\u0438\u043c\u043f\u0438\u0439\u0441\u043a\u0438\u0435 \u0438\u0433\u0440\u044b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1905_%D0%B3%D0%BE%D0%B4\" title=\"1905 \u0433\u043e\u0434\">1905<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B2%D0%B0%D1%81%D1%82%D0%BE%D0%BF%D0%BE%D0%BB%D1%8C\" title=\"\u0421\u0435\u0432\u0430\u0441\u0442\u043e\u043f\u043e\u043b\u044c\">\u0421\u0435\u0432\u0430\u0441\u0442\u043e\u043f\u043e\u043b\u0435<\/a>, \u043a 50-\u043b\u0435\u0442\u0438\u044e \u0433\u0435\u0440\u043e\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u043e\u0431\u043e\u0440\u043e\u043d\u044b \u0433\u043e\u0440\u043e\u0434\u0430, \u043e\u0442\u043a\u0440\u044b\u043b\u0430\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%B1%D0%BE%D1%80%D0%BE%D0%BD%D0%B0_%D0%A1%D0%B5%D0%B2%D0%B0%D1%81%D1%82%D0%BE%D0%BF%D0%BE%D0%BB%D1%8F_(%D0%BF%D0%B0%D0%BD%D0%BE%D1%80%D0%B0%D0%BC%D0%B0)\" title=\"\u041e\u0431\u043e\u0440\u043e\u043d\u0430 \u0421\u0435\u0432\u0430\u0441\u0442\u043e\u043f\u043e\u043b\u044f (\u043f\u0430\u043d\u043e\u0440\u0430\u043c\u0430)\">\u043f\u0430\u043d\u043e\u0440\u0430\u043c\u0430 \u00ab\u041e\u0431\u043e\u0440\u043e\u043d\u0430 \u0421\u0435\u0432\u0430\u0441\u0442\u043e\u043f\u043e\u043b\u044f\u00bb<\/a> \u0445\u0443\u0434\u043e\u0436\u043d\u0438\u043a\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D1%83%D0%B1%D0%BE,_%D0%A4%D1%80%D0%B0%D0%BD%D1%86_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B5%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0420\u0443\u0431\u043e, \u0424\u0440\u0430\u043d\u0446 \u0410\u043b\u0435\u043a\u0441\u0435\u0435\u0432\u0438\u0447\">\u0424.&#160;\u0410.&#160;\u0420\u0443\u0431\u043e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1906_%D0%B3%D0%BE%D0%B4\" title=\"1906 \u0433\u043e\u0434\">1906<\/a>&#160;\u2014 \u041e\u0442\u043a\u0440\u044b\u0432\u0430\u0435\u0442\u0441\u044f \u0434\u0432\u0438\u0436\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%B5%D0%B7%D0%B4\" title=\"\u041f\u043e\u0435\u0437\u0434\">\u043f\u043e\u0435\u0437\u0434\u043e\u0432<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B8%D0%BC%D0%BF%D0%BB%D0%BE%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%82%D0%BE%D0%BD%D0%BD%D0%B5%D0%BB%D1%8C\" title=\"\u0421\u0438\u043c\u043f\u043b\u043e\u043d\u0441\u043a\u0438\u0439 \u0442\u043e\u043d\u043d\u0435\u043b\u044c\">\u0421\u0438\u043c\u043f\u043b\u043e\u043d\u0441\u043a\u043e\u043c \u0442\u043e\u043d\u043d\u0435\u043b\u0435<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D1%8C%D0%BF%D1%8B\" title=\"\u0410\u043b\u044c\u043f\u044b\">\u0410\u043b\u044c\u043f\u044b<\/a>). \u041e\u043d \u0441\u043e\u0435\u0434\u0438\u043d\u044f\u0435\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B2%D0%B5%D0%B9%D1%86%D0%B0%D1%80%D0%B8%D1%8F\" title=\"\u0428\u0432\u0435\u0439\u0446\u0430\u0440\u0438\u044f\">\u0428\u0432\u0435\u0439\u0446\u0430\u0440\u0438\u044e<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%82%D0%B0%D0%BB%D0%B8%D1%8F\" title=\"\u0418\u0442\u0430\u043b\u0438\u044f\">\u0418\u0442\u0430\u043b\u0438\u044e<\/a> \u043d\u0430 \u0432\u044b\u0441\u043e\u0442\u0435 700&#160;\u043c, \u0435\u0433\u043e \u0434\u043b\u0438\u043d\u0430&#160;\u2014 19,8&#160;\u043a\u043c.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1908_%D0%B3%D0%BE%D0%B4\" title=\"1908 \u0433\u043e\u0434\">1908<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%B0%D1%82%D1%8C%D1%8F_%D0%A0%D0%B0%D0%B9%D1%82\" title=\"\u0411\u0440\u0430\u0442\u044c\u044f \u0420\u0430\u0439\u0442\">\u0423\u0438\u043b\u0431\u0443\u0440 \u0420\u0430\u0439\u0442<\/a> \u0432\u0437\u044f\u043b \u043d\u0430 \u0431\u043e\u0440\u0442 \u043f\u0435\u0440\u0432\u043e\u0433\u043e \u0432 \u043c\u0438\u0440\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%81%D1%81%D0%B0%D0%B6%D0%B8%D1%80\" title=\"\u041f\u0430\u0441\u0441\u0430\u0436\u0438\u0440\">\u043f\u0430\u0441\u0441\u0430\u0436\u0438\u0440\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BC%D0%BE%D0%BB%D1%91%D1%82\" title=\"\u0421\u0430\u043c\u043e\u043b\u0451\u0442\">\u0430\u044d\u0440\u043e\u043f\u043b\u0430\u043d\u0430<\/a>&#160;\u2014 \u0427\u0430\u0440\u043b\u044c\u0437\u0430 \u0423. \u0424\u044d\u0440\u043d\u0430\u0441\u0430 \u0438 \u0441\u043e\u0432\u0435\u0440\u0448\u0438\u043b \u043f\u043e\u043b\u0451\u0442 \u043d\u0430 600 \u043c\u0435\u0442\u0440\u043e\u0432, \u0434\u043b\u0438\u0432\u0448\u0438\u0439\u0441\u044f 28,6 \u0441\u0435\u043a\u0443\u043d\u0434\u044b.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1909_%D0%B3%D0%BE%D0%B4\" title=\"1909 \u0433\u043e\u0434\">1909<\/a>&#160;\u2014 \u041d\u0430\u0447\u0430\u0442\u0430 \u0434\u0435\u044f\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u044c \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u0430 \u00ab\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0441\u043a\u0438\u0439 \u0442\u0430\u043a\u0441\u043e\u043c\u043e\u0442\u043e\u0440\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1911_%D0%B3%D0%BE%D0%B4\" title=\"1911 \u0433\u043e\u0434\">1911<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0435<\/a> \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u0430\u0441\u044c \u0412\u0442\u043e\u0440\u0430\u044f \u043c\u0435\u0436\u0434\u0443\u043d\u0430\u0440\u043e\u0434\u043d\u0430\u044f \u0430\u0432\u0438\u0430\u0446\u0438\u043e\u043d\u043d\u0430\u044f \u043d\u0435\u0434\u0435\u043b\u044f.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1914_%D0%B3%D0%BE%D0%B4\" title=\"1914 \u0433\u043e\u0434\">1914<\/a>&#160;\u2014 \u041f\u0435\u0440\u0432\u044b\u0439 \u043f\u043e\u043b\u0451\u0442 \u043f\u043e\u043f\u043b\u0430\u0432\u043a\u043e\u0432\u043e\u0433\u043e \u0432\u0430\u0440\u0438\u0430\u043d\u0442\u0430 \u0441\u0430\u043c\u043e\u043b\u0451\u0442\u0430 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BB%D1%8C%D1%8F_%D0%9C%D1%83%D1%80%D0%BE%D0%BC%D0%B5%D1%86_(%D1%81%D0%B0%D0%BC%D0%BE%D0%BB%D1%91%D1%82)\" title=\"\u0418\u043b\u044c\u044f \u041c\u0443\u0440\u043e\u043c\u0435\u0446 (\u0441\u0430\u043c\u043e\u043b\u0451\u0442)\">\u0418\u043b\u044c\u044f \u041c\u0443\u0440\u043e\u043c\u0435\u0446<\/a>\u00bb <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B8%D0%BA%D0%BE%D1%80%D1%81%D0%BA%D0%B8%D0%B9,_%D0%98%D0%B3%D0%BE%D1%80%D1%8C_%D0%98%D0%B2%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0421\u0438\u043a\u043e\u0440\u0441\u043a\u0438\u0439, \u0418\u0433\u043e\u0440\u044c \u0418\u0432\u0430\u043d\u043e\u0432\u0438\u0447\">\u0418.&#160;\u0418.&#160;\u0421\u0438\u043a\u043e\u0440\u0441\u043a\u043e\u0433\u043e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1915_%D0%B3%D0%BE%D0%B4\" title=\"1915 \u0433\u043e\u0434\">1915<\/a>&#160;\u2014 \u0418\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f\">\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438<\/a> \u043d\u0430\u0447\u0430\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B5%D0%BF%D0%BE%D1%80%D1%82%D0%B0%D1%86%D0%B8%D1%8F\" title=\"\u0414\u0435\u043f\u043e\u0440\u0442\u0430\u0446\u0438\u044f\">\u0434\u0435\u043f\u043e\u0440\u0442\u0430\u0446\u0438\u044f<\/a> \u0432\u0441\u0435\u0445 \u043b\u0438\u0446, \u0437\u0430\u043f\u043e\u0434\u043e\u0437\u0440\u0435\u043d\u043d\u044b\u0445 \u0432 \u0441\u043e\u0442\u0440\u0443\u0434\u043d\u0438\u0447\u0435\u0441\u0442\u0432\u0435 \u0441 \u043d\u0435\u043f\u0440\u0438\u044f\u0442\u0435\u043b\u044c\u0441\u043a\u0438\u043c\u0438 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0430\u043c\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1917_%D0%B3%D0%BE%D0%B4\" title=\"1917 \u0433\u043e\u0434\">1917<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u0435<\/a> \u043e\u0442\u043a\u0440\u044b\u0442 I <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%81%D0%B5%D1%80%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D1%81%D1%8A%D0%B5%D0%B7%D0%B4_%D0%BC%D1%83%D1%81%D1%83%D0%BB%D1%8C%D0%BC%D0%B0%D0%BD\" title=\"\u0412\u0441\u0435\u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0438\u0439 \u0441\u044a\u0435\u0437\u0434 \u043c\u0443\u0441\u0443\u043b\u044c\u043c\u0430\u043d\">\u0412\u0441\u0435\u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0438\u0439 \u043c\u0443\u0441\u0443\u043b\u044c\u043c\u0430\u043d\u0441\u043a\u0438\u0439 \u0441\u044a\u0435\u0437\u0434<\/a>,- \u043e\u043a\u043e\u043b\u043e 800 \u0434\u0435\u043b\u0435\u0433\u0430\u0442\u043e\u0432, \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u044f\u0432\u0448\u0438\u0445 \u0440\u0430\u0437\u043b\u0438\u0447\u043d\u044b\u0435 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0438 \u0438 \u043f\u0430\u0440\u0442\u0438\u0438 \u043e\u0442 \u043a\u043e\u043d\u0441\u0435\u0440\u0432\u0430\u0442\u0438\u0432\u043d\u044b\u0445 \u0434\u043e \u0440\u0430\u0434\u0438\u043a\u0430\u043b\u044c\u043d\u044b\u0445, \u0437\u0430 \u0438\u0441\u043a\u043b\u044e\u0447\u0435\u043d\u0438\u0435\u043c \u043f\u0440\u0438\u043c\u043a\u043d\u0443\u0432\u0448\u0438\u0445 \u043a \u0431\u043e\u043b\u044c\u0448\u0435\u0432\u0438\u043a\u0430\u043c. 446 \u0433\u043e\u043b\u043e\u0441\u0430\u043c\u0438 \u043f\u0440\u043e\u0442\u0438\u0432 271 \u0441\u044a\u0435\u0437\u0434 \u0432\u044b\u0441\u043a\u0430\u0437\u0430\u043b\u0441\u044f \u0437\u0430 \u0434\u0435\u043c\u043e\u043a\u0440\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0443\u044e \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0443\u044e \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0443 \u043d\u0430 \u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u043e-\u0444\u0435\u0434\u0435\u0440\u0430\u0442\u0438\u0432\u043d\u044b\u0445 \u0442\u0435\u0440\u0440\u0438\u0442\u043e\u0440\u0438\u0430\u043b\u044c\u043d\u044b\u0445 \u043d\u0430\u0447\u0430\u043b\u0430\u0445 \u0441 \u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u043e-\u043a\u0443\u043b\u044c\u0442\u0443\u0440\u043d\u043e\u0439 \u0430\u0432\u0442\u043e\u043d\u043e\u043c\u0438\u0435\u0439 \u0434\u043b\u044f \u043d\u0430\u0440\u043e\u0434\u043e\u0432, \u043d\u0435 \u0438\u043c\u0435\u044e\u0449\u0438\u0445 \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u0451\u043d\u043d\u043e\u0439 \u0442\u0435\u0440\u0440\u0438\u0442\u043e\u0440\u0438\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1918_%D0%B3%D0%BE%D0%B4_%D0%B2_%D0%BA%D0%B8%D0%BD%D0%BE\" title=\"1918 \u0433\u043e\u0434 \u0432 \u043a\u0438\u043d\u043e\">1918<\/a>&#160;\u2014 \u041d\u0430 \u044d\u043a\u0440\u0430\u043d\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%B0%D1%8F_%D0%A4%D0%B5%D0%B4%D0%B5%D1%80%D0%B0%D1%82%D0%B8%D0%B2%D0%BD%D0%B0%D1%8F_%D0%A1%D0%BE%D1%86%D0%B8%D0%B0%D0%BB%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0\" title=\"\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u0430\u044f \u0424\u0435\u0434\u0435\u0440\u0430\u0442\u0438\u0432\u043d\u0430\u044f \u0421\u043e\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\">\u0420\u0421\u0424\u0421\u0420<\/a> \u0432\u044b\u0448\u0435\u043b \u0444\u0438\u043b\u044c\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%BE%D1%82%D0%B0%D0%B7%D0%B0%D0%BD%D0%BE%D0%B2,_%D0%AF%D0%BA%D0%BE%D0%B2_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041f\u0440\u043e\u0442\u0430\u0437\u0430\u043d\u043e\u0432, \u042f\u043a\u043e\u0432 \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u043e\u0432\u0438\u0447\">\u042f\u043a\u043e\u0432\u0430 \u041f\u0440\u043e\u0442\u0430\u0437\u0430\u043d\u043e\u0432\u0430<\/a> \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%82%D0%B5%D1%86_%D0%A1%D0%B5%D1%80%D0%B3%D0%B8%D0%B9_(%D1%84%D0%B8%D0%BB%D1%8C%D0%BC,_1918)\" title=\"\u041e\u0442\u0435\u0446 \u0421\u0435\u0440\u0433\u0438\u0439 (\u0444\u0438\u043b\u044c\u043c, 1918)\">\u041e\u0442\u0435\u0446 \u0421\u0435\u0440\u0433\u0438\u0439<\/a>\u00bb \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D0%B7%D0%B6%D1%83%D1%85%D0%B8%D0%BD,_%D0%98%D0%B2%D0%B0%D0%BD_%D0%98%D0%BB%D1%8C%D0%B8%D1%87\" title=\"\u041c\u043e\u0437\u0436\u0443\u0445\u0438\u043d, \u0418\u0432\u0430\u043d \u0418\u043b\u044c\u0438\u0447\">\u0418\u0432\u0430\u043d\u043e\u043c \u041c\u043e\u0437\u0436\u0443\u0445\u0438\u043d\u044b\u043c<\/a> \u0432 \u0433\u043b\u0430\u0432\u043d\u043e