043e \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%BB%D1%8C%D1%82%D0%B0\" title=\"\u041c\u0430\u043b\u044c\u0442\u0430\">\u041c\u0430\u043b\u044c\u0442\u0430<\/a> \u043f\u0440\u0438\u043d\u044f\u043b\u043e \u0434\u0435\u043a\u043b\u0430\u0440\u0430\u0446\u0438\u044e \u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B5%D0%B9%D1%82%D1%80%D0%B0%D0%BB%D0%B8%D1%82%D0%B5%D1%82\" title=\"\u041d\u0435\u0439\u0442\u0440\u0430\u043b\u0438\u0442\u0435\u0442\">\u043d\u0435\u0439\u0442\u0440\u0430\u043b\u0438\u0442\u0435\u0442\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1986_%D0%B3%D0%BE%D0%B4\" title=\"1986 \u0433\u043e\u0434\">1986<\/a>&#160;\u2014 \u0412 \u0442\u0435\u043b\u0435\u043e\u0431\u0440\u0430\u0449\u0435\u043d\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D1%80%D0%B1%D0%B0%D1%87%D1%91%D0%B2,_%D0%9C%D0%B8%D1%85%D0%B0%D0%B8%D0%BB_%D0%A1%D0%B5%D1%80%D0%B3%D0%B5%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0413\u043e\u0440\u0431\u0430\u0447\u0451\u0432, \u041c\u0438\u0445\u0430\u0438\u043b \u0421\u0435\u0440\u0433\u0435\u0435\u0432\u0438\u0447\">\u041c. \u0413\u043e\u0440\u0431\u0430\u0447\u0451\u0432<\/a> \u043e\u0442\u0440\u0438\u0446\u0430\u043b \u0441\u0435\u0440\u044c\u0451\u0437\u043d\u043e\u0441\u0442\u044c \u043f\u043e\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D0%B0%D1%80%D0%B8%D1%8F_%D0%BD%D0%B0_%D0%A7%D0%B5%D1%80%D0%BD%D0%BE%D0%B1%D1%8B%D0%BB%D1%8C%D1%81%D0%BA%D0%BE%D0%B9_%D0%90%D0%AD%D0%A1\" title=\"\u0410\u0432\u0430\u0440\u0438\u044f \u043d\u0430 \u0427\u0435\u0440\u043d\u043e\u0431\u044b\u043b\u044c\u0441\u043a\u043e\u0439 \u0410\u042d\u0421\">\u0447\u0435\u0440\u043d\u043e\u0431\u044b\u043b\u044c\u0441\u043a\u043e\u0439 \u0430\u0432\u0430\u0440\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1990_%D0%B3%D0%BE%D0%B4\" title=\"1990 \u0433\u043e\u0434\">1990<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B5%D0%B7%D0%B8%D0%B4%D0%B5%D0%BD%D1%82_%D0%A1%D0%A1%D0%A1%D0%A0\" title=\"\u041f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 \u0421\u0421\u0421\u0420\">\u041f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 \u0421\u0421\u0421\u0420<\/a> \u041c\u0438\u0445\u0430\u0438\u043b \u0413\u043e\u0440\u0431\u0430\u0447\u0451\u0432 \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043b \u0423\u043a\u0430\u0437, \u043e\u0431\u044a\u044f\u0432\u043b\u044f\u044e\u0449\u0438\u0439 \u043d\u0435\u0434\u0435\u0439\u0441\u0442\u0432\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u043c\u0438 \u0434\u0435\u043a\u043b\u0430\u0440\u0430\u0446\u0438\u0438 \u043e \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D1%82%D0%B2%D0%B0\" title=\"\u041b\u0438\u0442\u0432\u0430\">\u041b\u0438\u0442\u0432\u044b<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D1%81%D1%82%D0%BE%D0%BD%D0%B8%D1%8F\" title=\"\u042d\u0441\u0442\u043e\u043d\u0438\u044f\">\u042d\u0441\u0442\u043e\u043d\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1991_%D0%B3%D0%BE%D0%B4\" title=\"1991 \u0433\u043e\u0434\">1991<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%BD%D0%B4%D0%B5%D0%BB%D0%B0,_%D0%92%D0%B8%D0%BD%D0%BD%D0%B8\" title=\"\u041c\u0430\u043d\u0434\u0435\u043b\u0430, \u0412\u0438\u043d\u043d\u0438\">\u0412\u0438\u043d\u043d\u0438 \u041c\u0430\u043d\u0434\u0435\u043b\u0430<\/a> (Winnie Madikizela-Mandela), \u0436\u0435\u043d\u0430 \u0431\u043e\u0440\u0446\u0430 \u043f\u0440\u043e\u0442\u0438\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BF%D0%B0%D1%80%D1%82%D0%B5%D0%B8%D0%B4\" title=\"\u0410\u043f\u0430\u0440\u0442\u0435\u0438\u0434\">\u0430\u043f\u0430\u0440\u0442\u0435\u0438\u0434\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%BD%D0%B4%D0%B5%D0%BB%D0%B0,_%D0%9D%D0%B5%D0%BB%D1%8C%D1%81%D0%BE%D0%BD\" title=\"\u041c\u0430\u043d\u0434\u0435\u043b\u0430, \u041d\u0435\u043b\u044c\u0441\u043e\u043d\">\u041d\u0435\u043b\u044c\u0441\u043e\u043d\u0430 \u041c\u0430\u043d\u0434\u0435\u043b\u044b<\/a>, \u043f\u0440\u0438\u0433\u043e\u0432\u043e\u0440\u0435\u043d\u0430 \u043a \u0448\u0435\u0441\u0442\u0438 \u0433\u043e\u0434\u0430\u043c \u0437\u0430\u043a\u043b\u044e\u0447\u0435\u043d\u0438\u044f \u043f\u043e \u043e\u0431\u0432\u0438\u043d\u0435\u043d\u0438\u044e \u0432 \u043f\u043e\u0445\u0438\u0449\u0435\u043d\u0438\u0438 \u043b\u044e\u0434\u0435\u0439.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1993_%D0%B3%D0%BE%D0%B4\" title=\"1993 \u0433\u043e\u0434\">1993<\/a>&#160;\u2014 \u0421\u043e\u0437\u0434\u0430\u043d \u044d\u043a\u043e\u043d\u043e\u043c\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0441\u043e\u044e\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B4%D1%80%D1%83%D0%B6%D0%B5%D1%81%D1%82%D0%B2%D0%BE_%D0%9D%D0%B5%D0%B7%D0%B0%D0%B2%D0%B8%D1%81%D0%B8%D0%BC%D1%8B%D1%85_%D0%93%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2\" title=\"\u0421\u043e\u0434\u0440\u0443\u0436\u0435\u0441\u0442\u0432\u043e \u041d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u044b\u0445 \u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\">\u0421\u041d\u0413<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1993_%D0%B3%D0%BE%D0%B4\" title=\"1993 \u0433\u043e\u0434\">1993<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D1%82%D0%B2%D0%B0\" title=\"\u041b\u0438\u0442\u0432\u0430\">\u041b\u0438\u0442\u0432\u0430<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BB%D0%BE%D0%B2%D0%B5%D0%BD%D0%B8%D1%8F\" title=\"\u0421\u043b\u043e\u0432\u0435\u043d\u0438\u044f\">\u0421\u043b\u043e\u0432\u0435\u043d\u0438\u044f<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D1%81%D1%82%D0%BE%D0%BD%D0%B8%D1%8F\" title=\"\u042d\u0441\u0442\u043e\u043d\u0438\u044f\">\u042d\u0441\u0442\u043e\u043d\u0438\u044f<\/a> \u0441\u0442\u0430\u043d\u043e\u0432\u044f\u0442\u0441\u044f \u0447\u043b\u0435\u043d\u0430\u043c\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B2%D0%B5%D1%82_%D0%95%D0%B2%D1%80%D0%BE%D0%BF%D1%8B\" title=\"\u0421\u043e\u0432\u0435\u0442 \u0415\u0432\u0440\u043e\u043f\u044b\">\u0421\u043e\u0432\u0435\u0442\u0430 \u0415\u0432\u0440\u043e\u043f\u044b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1995_%D0%B3%D0%BE%D0%B4\" title=\"1995 \u0433\u043e\u0434\">1995<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D0%BB%D0%B0%D1%80%D1%83%D1%81%D1%8C\" class=\"mw-redirect\" title=\"\u0411\u0435\u043b\u0430\u0440\u0443\u0441\u044c\">\u0411\u0435\u043b\u043e\u0440\u0443\u0441\u0441\u0438\u0438<\/a> \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u0441\u044f \u043f\u0435\u0440\u0432\u044b\u0439 \u0442\u0443\u0440 \u0432\u044b\u0431\u043e\u0440\u043e\u0432 \u0432 \u0412\u0435\u0440\u0445\u043e\u0432\u043d\u044b\u0439 \u0421\u043e\u0432\u0435\u0442 \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0438 \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D1%84%D0%B5%D1%80%D0%B5%D0%BD%D0%B4%D1%83%D0%BC\" title=\"\u0420\u0435\u0444\u0435\u0440\u0435\u043d\u0434\u0443\u043c\">\u0440\u0435\u0444\u0435\u0440\u0435\u043d\u0434\u0443\u043c<\/a>. \u041e\u0434\u043e\u0431\u0440\u0435\u043d\u044b \u043f\u0440\u0435\u0434\u043b\u043e\u0436\u0435\u043d\u0438\u044f \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D1%83%D0%BA%D0%B0%D1%88%D0%B5%D0%BD%D0%BA%D0%BE,_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_%D0%93%D1%80%D0%B8%D0%B3%D0%BE%D1%80%D1%8C%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u041b\u0443\u043a\u0430\u0448\u0435\u043d\u043a\u043e, \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u0413\u0440\u0438\u0433\u043e\u0440\u044c\u0435\u0432\u0438\u0447\">\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430 \u041b\u0443\u043a\u0430\u0448\u0435\u043d\u043a\u043e<\/a> \u043e \u0431\u043e\u043b\u0435\u0435 \u0442\u0435\u0441\u043d\u043e\u0439 \u0438\u043d\u0442\u0435\u0433\u0440\u0430\u0446\u0438\u0438 \u0441 \u0420\u043e\u0441\u0441\u0438\u0435\u0439, \u043f\u0440\u0438\u0434\u0430\u043d\u0438\u0438 \u0440\u0443\u0441\u0441\u043a\u043e\u043c\u0443 \u044f\u0437\u044b\u043a\u0443 \u0441\u0442\u0430\u0442\u0443\u0441\u0430 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0433\u043e \u043d\u0430\u0440\u0430\u0432\u043d\u0435 \u0441 \u0431\u0435\u043b\u043e\u0440\u0443\u0441\u0441\u043a\u0438\u043c \u0438 \u043e\u0431 \u043e\u0442\u043c\u0435\u043d\u0435 \u043d\u043e\u0432\u043e\u0439 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u0441\u0438\u043c\u0432\u043e\u043b\u0438\u043a\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1998_%D0%B3%D0%BE%D0%B4\" title=\"1998 \u0433\u043e\u0434\">1998<\/a>&#160;\u2014 \u0410\u0433\u0435\u043d\u0442\u0441\u0442\u0432\u043e \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%81%D1%81%D0%BE%D1%88%D0%B8%D1%8D%D0%B9%D1%82%D0%B5%D0%B4_%D0%9F%D1%80%D0%B5%D1%81%D1%81\" title=\"\u0410\u0441\u0441\u043e\u0448\u0438\u044d\u0439\u0442\u0435\u0434 \u041f\u0440\u0435\u0441\u0441\">\u0410\u0441\u0441\u043e\u0448\u0438\u044d\u0439\u0442\u0435\u0434 \u041f\u0440\u0435\u0441\u0441<\/a>\u00bb \u043e\u0442\u043f\u0440\u0430\u0437\u0434\u043d\u043e\u0432\u0430\u043b\u043e \u0441\u0432\u043e\u0451 150-\u043b\u0435\u0442\u0438\u0435.<\/li><\/ul><h3>XXI \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2006_%D0%B3%D0%BE%D0%B4\" title=\"2006 \u0433\u043e\u0434\">2006<\/a>&#160;\u2014 \u043f\u043e\u0441\u043b\u0435 \u043f\u043e\u0431\u0435\u0434\u044b \u043d\u0430 \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u0441\u043a\u0438\u0445 \u0432\u044b\u0431\u043e\u0440\u0430\u0445 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0_%D0%93%D0%B0%D0%B8%D1%82%D0%B8\" title=\"\u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430 \u0413\u0430\u0438\u0442\u0438\">\u0413\u0430\u0438\u0442\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B5%D0%B2%D0%B0%D0%BB%D1%8C,_%D0%A0%D0%B5%D0%BD%D0%B5\" title=\"\u041f\u0440\u0435\u0432\u0430\u043b\u044c, \u0420\u0435\u043d\u0435\">\u0420\u0435\u043d\u0435 \u041f\u0440\u0435\u0432\u0430\u043b\u044f<\/a>, \u0432\u0440\u0435\u043c\u0435\u043d\u043d\u044b\u0439 \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80,_%D0%91%D0%BE%D0%BD%D0%B8%D1%84%D0%B0%D1%81\" title=\"\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440, \u0411\u043e\u043d\u0438\u0444\u0430\u0441\">\u0411\u043e\u043d\u0438\u0444\u0430\u0441 \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440<\/a> \u0443\u0448\u0451\u043b \u0432 \u043e\u0442\u0441\u0442\u0430\u0432\u043a\u0443.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2008_%D0%B3%D0%BE%D0%B4\" title=\"2008 \u0433\u043e\u0434\">2008<\/a>&#160;\u2014 \u0424\u0443\u0442\u0431\u043e\u043b\u044c\u043d\u044b\u0439 \u043a\u043b\u0443\u0431 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B5%D0%BD%D0%B8%D1%82_(%D1%84%D1%83%D1%82%D0%B1%D0%BE%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D0%BA%D0%BB%D1%83%D0%B1,_%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3)\" title=\"\u0417\u0435\u043d\u0438\u0442 (\u0444\u0443\u0442\u0431\u043e\u043b\u044c\u043d\u044b\u0439 \u043a\u043b\u0443\u0431, \u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433)\">\u0417\u0435\u043d\u0438\u0442 (\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433)<\/a> \u0432\u044b\u0438\u0433\u0440\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%83%D0%B1%D0%BE%D0%BA_%D0%A3%D0%95%D0%A4%D0%90\" class=\"mw-redirect\" title=\"\u041a\u0443\u0431\u043e\u043a \u0423\u0415\u0424\u0410\">\u041a\u0443\u0431\u043e\u043a \u0423\u0415\u0424\u0410<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2008_%D0%B3%D0%BE%D0%B4\" title=\"2008 \u0433\u043e\u0434\">2008<\/a>&#160;\u2014 \u041f\u0435\u0440\u0432\u0430\u044f \u0440\u0430\u043a\u0435\u0442\u043a\u0430 \u043c\u0438\u0440\u0430 \u0432 \u043e\u0434\u0438\u043d\u043e\u0447\u043d\u043e\u043c \u0440\u0430\u0437\u0440\u044f\u0434\u0435 \u043f\u043e \u0438\u0442\u043e\u0433\u0430\u043c 2003, 2004, 2006 \u0438 2007 \u0433\u043e\u0434\u043e\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%BD%D0%B5%D0%BD,_%D0%96%D1%8E%D1%81%D1%82%D0%B8%D0%BD\" title=\"\u042d\u043d\u0435\u043d, \u0416\u044e\u0441\u0442\u0438\u043d\">\u0416\u044e\u0441\u0442\u0438\u043d \u042d\u043d\u0435\u043d<\/a> \u043e\u0431\u044a\u044f\u0432\u0438\u043b\u0430 \u043e \u043f\u0440\u0435\u043a\u0440\u0430\u0449\u0435\u043d\u0438\u0438 \u0441\u043f\u043e\u0440\u0442\u0438\u0432\u043d\u043e\u0439 \u043a\u0430\u0440\u044c\u0435\u0440\u044b.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2009_%D0%B3%D0%BE%D0%B4\" title=\"2009 \u0433\u043e\u0434\">2009<\/a>&#160;\u2014 \u0411\u044b\u043b \u0437\u0430\u043f\u0443\u0449\u0435\u043d \u043d\u0430 \u043e\u0440\u0431\u0438\u0442\u0443 \u0442\u0435\u043b\u0435\u0441\u043a\u043e\u043f \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D1%80%D1%88%D0%B5%D0%BB%D1%8C_(%D0%BA%D0%BE%D1%81%D0%BC%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D1%81%D0%B5%D1%80%D0%B2%D0%B0%D1%82%D0%BE%D1%80%D0%B8%D1%8F)\" title=\"\u0413\u0435\u0440\u0448\u0435\u043b\u044c (\u043a\u043e\u0441\u043c\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043e\u0431\u0441\u0435\u0440\u0432\u0430\u0442\u043e\u0440\u0438\u044f)\">\u0413\u0435\u0440\u0448\u0435\u043b\u044c<\/a>\u00bb, \u043d\u0430\u0437\u0432\u0430\u043d\u043d\u044b\u0439 \u0432 \u0447\u0435\u0441\u0442\u044c \u0431\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u043e\u0433\u043e \u0430\u0441\u0442\u0440\u043e\u043d\u043e\u043c\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D1%80%D1%88%D0%B5%D0%BB%D1%8C,_%D0%A3%D0%B8%D0%BB%D1%8C%D1%8F%D0%BC\" title=\"\u0413\u0435\u0440\u0448\u0435\u043b\u044c, \u0423\u0438\u043b\u044c\u044f\u043c\">\u0423\u0438\u043b\u044c\u044f\u043c\u0430 \u0413\u0435\u0440\u0448\u0435\u043b\u044f<\/a>.<\/li><\/ul><h2>"}